#* [[よだか]]は、実に[[みにくい]][[とり|鳥]]です。 顔は、[[ところどころ]]、 {{ふりがな|味噌|みそ}}をつけたように[[まだら]]で、[[くちばし]]は、[[ひらたい|ひらた]]くて、耳まで[[さける|さけ]]ています。（[[w:宮沢賢治|宮沢賢治]]『[[w:よだかの星|よだかの星]]』）〔1934年〕
# 見て[[不愉快]]な感じがする。
#* 私の[[健康]]な[[肉体]]は一方では私を悩しく[[みにくい|醜い]]活動にまで[[おいやる|追いやる]]とともに、他方では私の[[純粋]]な魂が[[なす|なそ]]うとする活動を妨げようとする。（[[w:三木清|三木清]]『語られざる哲学』）〔1919年〕
#* いろいろ[[みにくい|醜い]][[後悔]]ばっかり、[[いちど]]に、[[どっと]]かたまって胸をふさぎ、{{ふりがな|身悶|みもだ|え}}えしちゃう。（[[w:太宰治|太宰治]]『[[w:女生徒|女生徒]]』）〔1954年〕
